import React from 'react';
import { Box, Container, Typography, Paper, Grid } from '@mui/material';

const Experience = () => {
  const experiences = [
    {
      title: 'Software Development Engineer',
      company: 'Company Name',
      period: 'September, 2023 - Present',
      points: [
        'Built a HIPAA-compliant data pipeline using Python and PostgreSQL, containerized with Docker and Apptainer.',
        'Architected a modular multi-agent AI in Python, improving factual accuracy by 70%.',
        'Employed Apache Kafka to orchestrate asynchronous message flows.',
      ],
    },
    {
      title: 'Software Engineer',
      company: 'Previous Company',
      period: 'March, 2021 - July, 2023',
      points: [
        'Led the complete SDLC of a high-impact Big Data Solution.',
        'Engineered critical features including User Authentication and REST API endpoints.',
        'Developed monitoring dashboards and utilities.',
      ],
    },
  ];

  return (
    <Box
      id="experience"
      sx={{
        py: 8,
        backgroundColor: 'background.paper',
      }}
    >
      <Container>
        <Typography
          variant="h2"
          sx={{
            mb: 6,
            textAlign: 'center',
            color: 'text.primary',
          }}
        >
          Work Experience
        </Typography>
        <Grid container spacing={4}>
          {experiences.map((exp, index) => (
            <Grid item xs={12} key={index}>
              <Paper
                elevation={3}
                sx={{
                  p: 4,
                  backgroundColor: 'background.default',
                  transition: 'transform 0.2s',
                  '&:hover': {
                    transform: 'translateY(-5px)',
                  },
                }}
              >
                <Typography variant="h5" color="primary" gutterBottom>
                  {exp.title}
                </Typography>
                <Typography variant="h6" color="text.secondary" gutterBottom>
                  {exp.company}
                </Typography>
                <Typography variant="subtitle1" color="text.secondary" gutterBottom>
                  {exp.period}
                </Typography>
                <Box component="ul" sx={{ mt: 2, pl: 2 }}>
                  {exp.points.map((point, idx) => (
                    <Typography
                      component="li"
                      key={idx}
                      sx={{
                        mb: 1,
                        color: 'text.primary',
                      }}
                    >
                      {point}
                    </Typography>
                  ))}
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Experience;
